import React, { useState } from "react";
import table from "../dashboard/component/data/tabledata.json"

const DataSearch = () => {
  const [searchdata, setSearchData] = useState("");


  return (
    <div>

      <div className="data-search">
        <div className="data-search__input">
        <input type="text" placeholder="Search Data by ICAO" onChange={(event) => {
          setSearchData(event.target.value);
        }}/>
        {/* <button><i class="bi bi-search"></i></button> */}

        {
          table.filter((val)=>{
            if(searchdata == ""){
              return null;
            } else if (val.icao24.toLowerCase.inculdes(searchdata.toLowerCase())){
              return val
            }
          }).map((val, key)=>{
            return (
              <div>
                <p>{val.icao24}</p>
              </div>
            )
          })
        }
        </div>
      </div>
    </div>
  );
};

export default DataSearch;
